package com.leet;

import junit.framework.Test;
import junit.framework.TestCase;
import junit.framework.TestSuite;
import com.leet.Solution;
/**
 * Unit test for simple App.
 */
public class MainTest 
    extends TestCase
{
    /**
     * Create the test case
     *
     * @param testName name of the test case
     */
    public MainTest( String testName )
    {
        super( testName );
    }

    /**
     * @return the suite of tests being tested
     */
    public static Test suite()
    {
        return new TestSuite( MainTest.class );
    }

    /**
     * Rigourous Test :-)
     */
    public void testApp()
    {
        Solution obj = new Solution();
        String s = obj.minWindow("afecfaegsegsc", "ac");
        System.out.println("result = " + s);
        assertEquals("cfa", s);
    }

    /**
     * Test no match any thing
     */
    public void testMatchNothing()
    {
        Solution obj = new Solution();
        String s = obj.minWindow("ADOBECODEBANC", "AZZKLEBC");
        System.out.println("result = " + s);
        assertEquals("", s);
    }

    /**
     * Test empty
     */
    public void testEmpty()
    {
        Solution obj = new Solution();
        String s = obj.minWindow("", "AZZKLEBC");
        System.out.println("result = " + s);
        assertEquals("", s);
    }




   /**
     * Normal test
     */
    public void testNormal1()
    {
        Solution obj = new Solution();
        String s = obj.minWindow("ADOBECODEBANC", "ABC");
        System.out.println("result = " + s);
        assertEquals("BANC", s);
    }

    
    /**
     * Test long
     */
    public void testLong()
    {
        Solution obj = new Solution();
        String s = obj.minWindow("", "");
        //System.out.println("result = " + s);
        assertEquals("", s);
    }



}
